import { useState } from "react";

function List() {
  const [names, setNames] = useState([]);

  function addName() {
    setNames((prev) => [...prev, "Karthick"]);
  }

  return (
    <div>
      <button onClick={addName}>Add Name</button>

      <ul>
        {names.map((name, index) => (
          <li key={index}>{name}</li>
        ))}
      </ul>
    </div>
  );
}
export default List;
